import React from 'react'
import UserNavbar from '../../Layout/User/UserNavbar'
import UserSidebar from '../../Layout/User/UserSidebar'
import {Outlet} from "react-router-dom";

export default function UserDashboard() {
  return (
    <div>
      <UserNavbar/>
      <UserSidebar/>
      <Outlet/>
    </div>
  )
}
